const Header = () => <div>Шапка</div>;
const Footer = () => <div>Футер</div>

function App() {
  return (
    <>
      <Header />>
      <Content>
          <h2>Контент страницы</h2>
      </Content>
      <Footer />>

    </>
  );
}

export default App;
